import React from "react";
import { ReactSVG } from 'react-svg';

const themes = require("../../../../../public/assets/Themes.svg") as string;

export type iconProps=
{
imageSrc:string;
}

const BackIcon = ({imageSrc}:iconProps)=> {
    return(
        <ReactSVG src={themes} />
    )
}

export default BackIcon;
